create table osoba
(
    osoba_id   int auto_increment
        primary key,
    meno       varchar(45)  not null,
    priezvisko varchar(45)  not null,
    rod_cislo  varchar(10)  not null,
    Pohlavie   varchar(255) null,
    bydlisko   varchar(255) null,
    telefon    varchar(45)  null,
    email      varchar(255) null,
    pozicia_id int          null,
    constraint osoba_ibfk_1
        foreign key (pozicia_id) references pozicie (pozicia_id)
);

create index pozicia_id
    on osoba (pozicia_id);

